<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1.0"/>
  <title>Battery Alert</title>
  <style>
   body {
  font-family: Arial, sans-serif;
  background-color: #f0f0f0;
  margin: 0;
  padding: 20px;
  text-align: center;
}

.popup {
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: rgba(0, 0, 0, 0.6);
  display: flex;
  align-items: center;
  justify-content: center;
  z-index: 1000;
}

.popup-content {
  background: white;
  padding: 30px;
  border-radius: 10px;
  text-align: center;
}

.popup-content input {
  padding: 10px;
  font-size: 16px;
  margin: 10px 0;
  width: 80px;
}

.popup-content button {
  padding: 10px 20px;
  font-size: 16px;
  cursor: pointer;
}

.hidden {
  display: none !important;
}

#statusSection p {
  font-size: 18px;
  margin: 20px 0;
}

#statusSection button {
  padding: 10px 15px;
  font-size: 16px;
  cursor: pointer;
}

.error {
  color: red;
  margin-top: 10px;
  font-size: 14px;
}


  </style>
</head>
<body>
    <!-- Target Battery Input Popup -->
    <div id="popup" class="popup">
    <div class="popup-content">
        <h2>Set Target Battery Percentage</h2>
        <p id="currentBatteryText">Current Battery: --%</p>
        <input type="number" id="targetInput" placeholder="e.g. 85" min="1" max="100" />
        <p id="errorMsg" class="error hidden">Error message here</p>
        <div style="margin-top: 15px;">
        <button onclick="setTarget()">OK</button>
        <button onclick="closePopup()" class="hidden" id="closeBtn">Close</button>
        </div>
    </div>
    </div>

    <!-- Alert when battery is full -->
    <div id="alertPopup" class="popup hidden">
        <div class="popup-content">
        <h2>ðŸŽ‰ Battery Reached!</h2>
        <p>Your device has reached the desired battery level.</p>
        <button onclick="dismissAlert()">Dismiss</button>
        </div>
    </div>

    <!-- Status and control -->
    <div id="statusSection" class="hidden">
        <p id="statusText">Charging... Waiting for X%</p>
        <button onclick="openPopup()">Change Target</button>
    </div>

  <script>
    let targetLevel = null;
    let checkInterval = null;
    let alarmPlayed = false;
    let currentBatteryLevel = null;

    window.onload = function () {
    // Ask for notification permission
        if (Notification.permission !== "granted") {
            Notification.requestPermission();
        }

        showPopup();
    };

    function closePopup() {
        document.getElementById("popup").classList.add("hidden");
    }

    function showPopup() {
        navigator.getBattery().then(function (battery) {
            currentBatteryLevel = Math.round(battery.level * 100);
            document.getElementById("currentBatteryText").textContent =
            `Current Battery: ${currentBatteryLevel}%`;

            if(targetLevel){
                document.getElementById("closeBtn").classList.remove("hidden");
            } else {
                document.getElementById("closeBtn").classList.add("hidden");
            }
            // Pre-fill previous value if exists
            document.getElementById("targetInput").value = targetLevel || "";
            document.getElementById("errorMsg").classList.add("hidden");
            document.getElementById("popup").classList.remove("hidden");
        });
    }

    function setTarget() {
        const input = document.getElementById("targetInput").value;
        const parsed = parseInt(input);
        const errorMsg = document.getElementById("errorMsg");

        if (isNaN(parsed) || parsed < 1 || parsed > 100) {
            errorMsg.textContent = "Please enter a valid percentage between 1 and 100.";
            errorMsg.classList.remove("hidden");
            clearExistingInterval();
            return;
        }

        if (parsed <= currentBatteryLevel) {
            errorMsg.textContent = "You entered an already charged level. Please choose a higher percentage.";
            errorMsg.classList.remove("hidden");
            clearExistingInterval();
            return;
        }

        targetLevel = parsed;
        alarmPlayed = false;

        // Hide popup
        document.getElementById("popup").classList.add("hidden");

        // Show status
        document.getElementById("statusSection").classList.remove("hidden");
        document.getElementById("statusText").textContent =
            `Charging... Waiting for ${targetLevel}%`;

        // Clear and restart timer
        clearExistingInterval();
        checkBatteryStatus();
    }

    function checkBatteryStatus() {
        if (!navigator.getBattery) {
            alert("Battery API is not supported in this browser.");
            return;
        }

        navigator.getBattery().then(function (battery) {
            // Store current level on every check
            currentBatteryLevel = Math.round(battery.level * 100);

            evaluateBattery(battery);

            checkInterval = setInterval(() => {
                currentBatteryLevel = Math.round(battery.level * 100);
                evaluateBattery(battery);
            }, 45000);
        });
    }

    function evaluateBattery(battery) {
        const level = Math.round(battery.level * 100);
        console.log(`Battery Level: ${level}%`);

        if (!alarmPlayed && level >= targetLevel) {
            alarmPlayed = true;
            triggerAlarm();
        }
    }

    function triggerAlarm() {
        // Play sound
        const alarm = document.getElementById("alarmSound");
        alarm.play();

        document.getElementById("statusText").textContent =
            `Charged: ${targetLevel}%`;
        // Show alert popup
        document.getElementById("alertPopup").classList.remove("hidden");

        // Desktop notification
        if (Notification.permission === "granted") {
            new Notification("Battery Full!", {
                body: `Battery has reached ${targetLevel}%`,
                icon: `./battery-charging.png`,
            });
        }

        // Stop further checks
        clearExistingInterval();
    }

    function dismissAlert() {
        document.getElementById("alertPopup").classList.add("hidden");

        const alarm = document.getElementById("alarmSound");
        alarm.pause();
        alarm.currentTime = 0;

        clearExistingInterval();
    }

    function openPopup() {
        showPopup();
    }

    function clearExistingInterval() {
        if (checkInterval) {
            clearInterval(checkInterval);
            checkInterval = null;
        }
    }

  </script>
